import React from 'react';
import classNames from 'classnames';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import InputAdornment from '@material-ui/core/InputAdornment';
import TextField from '@material-ui/core/TextField';
import Card from '@material-ui/core/Card';
import CardActionArea from '@material-ui/core/CardActionArea';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import Button from '@material-ui/core/Button';
import MenuItem from '@material-ui/core/MenuItem';
import Typography from '@material-ui/core/Typography';

const styles = theme => ({
  root: {
    display: 'flex',
    flexWrap: 'wrap',
  },
  margin: {
    margin: theme.spacing.unit,
  },
  withoutLabel: {
    marginTop: theme.spacing.unit * 3,
  },
  textField: {
    flexBasis: 200,
  },
  card: {
    maxWidth: 445,
  },
  
});

const whenDD = [
  {
    value: 'NOW',
    label: 'NOW',
  },
  {
    value: 'LATER',
    label: 'DELIVER LATER',
  },
];

class BookDelivery extends React.Component {
  state = {
    amount: '',
    password: '',
    weight: '',
    weightRange: '',
    showPassword: false,
  };

  handleChange = prop => event => {
    this.setState({ [prop]: event.target.value });
  };

  render() {
    const { classes } = this.props;

    return (
      <div className={classes.root + " mainDiv "}>
      <Card className={classes.card + " card "}>
        {/* <CardActionArea> */}
            <CardContent>
            <Typography gutterBottom variant="h5" component="h2">
                Make Delivery Easy
            </Typography>
            <Typography component="p">
                Assign delivery to us sit back and relax.
            </Typography>
            </CardContent>
            <TextField
            id="pick-up-location"
            className={classNames(classes.margin, classes.textField) + " fields "}
            InputProps={{
                startAdornment: <InputAdornment position="start">PICKUP</InputAdornment>,
            }}
            />
            <br/>
            <TextField
            id="drop-location"
            className={classNames(classes.margin, classes.textField) + " fields "}
            InputProps={{
                startAdornment: <InputAdornment position="start">DROP</InputAdornment>,
            }}
            />
            <br/>
            <TextField
            select
            className={classNames(classes.margin, classes.textField) + " fields "}
            value={this.state.weightRange}
            onChange={this.handleChange('weightRange')}
            InputProps={{
                startAdornment: <InputAdornment position="start">WHEN</InputAdornment>,
            }}
            >
            {whenDD.map(option => (
                <MenuItem key={option.value} value={option.value}>
                {option.label}
                </MenuItem>
            ))}
            </TextField>
        {/* </CardActionArea> */}
        {/* <CardActions> */}
            <Button size="small" color="primary" className="button-lg">
                Book Now
            </Button>
        {/* </CardActions> */}
      </Card>
        

        
      </div>
    );
  }
}

BookDelivery.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(BookDelivery);
